import styled from "styled-components";
import image1 from "../../assets/images/image1.jpg"
import image2 from "../../assets/images/image2.jpg"
import image3 from "../../assets/images/image3.jpg"
import image4 from "../../assets/images/image4.jpg"


const GridContainer = styled.div`
  background-color: #9fbb99;
  display: grid;
  grid-template-columns: 1fr 1fr 1fr;
  grid-gap: 16px;

`;

const GridItem = styled.img`
  width: 100%;


  /* Lägg till eventuella ytterligare stilar för grid-items (bilderna) */
`;


const GridItemLarge = styled(GridItem)`
  grid-column: span 2;
  /* Lägg till eventuella ytterligare stilar för större grid-items */
`;

const Grid = () => { 

  return (
    <GridContainer>
   <GridItem src={image1} alt="Image 1" />
       <GridItem src={image2} alt="Image 2" />
      <GridItem src={image3} alt="Image 3" />
      <GridItemLarge src={image4} alt="Image 4" />
      <GridItem src={image5} alt="Image 5" /> 
    </GridContainer>
  );
};

export default Grid;
